sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
	var reqJson = {};
	for (var key in inputs) {
		if (inputs[key]) {
			if (key != "deactivate" || key != "registration_date") {
				reqJson[key] = inputs[key] ? inputs[key] : undefined;
			}
		}
	}
	if (inputs.deactivate == true)
		reqJson["active"] = "false";
	else
		reqJson["active"] = "true";

	if (inputs.registration_date) {
		var str = inputs.registration_date;
		var res = str.split(" ");
		reqJson["registration_date"] = res[0] + "T" + res[1];
	}
	outputs.reqbody = JSON.stringify(reqJson);

})(inputs, outputs);

